class Broker:
    def Buy(self, tran):
        tran.is_success = True
        print ('bought: ', tran)
        return tran
    def Sell(self, tran):
        tran.is_success = True
        print('sold: ', tran)
        return tran
class Transaction_data:
    BUY = 'b'
    SELL = 's'
    def __init__(self, token, qty, price, buyorsell):
        self.token = token
        self.qty = qty
        self.price = price
        self.buyorsell = buyorsell
        self.is_success = False
    def __repr__(self) -> str:
        return f'Token: {self.token} Qty: {self.qty} price: {self.price} b/s: {self.buyorsell} success: {self.is_success}'
class user_transactions:
    def __init__(self, user_data):
        self.list_pnl = []
        self.opening_balance = user_data['balance']
        self.user_id = user_data['userid']
        self.max_loss_perc_pd = user_data['max_loss_perc_pd']
        self.max_profit_perc_pd = user_data['max_profit_perc_pd']
        self.buy_amount = 0
        self.outstanding_qty = 0
        self.buy_flag=0
        self.sell_flag=0
        self.sell_amount=0
        self.strategy=Strategy7
        self.preference=0
        self.no_of_trades=0
    def get_current_balance (self):
        #calculate the current balance
        if self.preference==1:
            return self.opening_balance + sum(self.list_pnl) - self.buy_amount
        
        else:
            return self.opening_balance + sum(self.list_pnl)

    def Buy_update(self, tran):
        if self.preference==1:
            self.preference=1
            self.buy_amount += tran.qty * tran.price
            self.outstanding_qty += tran.qty
            


        else:
            self.preference=2
            self.outstanding_qty -= tran.qty
            self.sell_amount-= tran.qty * tran.price
            self.list_pnl.append( tran.qty * (tran.price - self.sell_amount/self.outstanding_qty))
            self.no_of_trades=self.no_of_trades+1


    def Sell_update(self, tran, preference):
        if preference==1:
            self.preference=1
            self.outstanding_qty -= tran.qty
            self.buy_amount -= tran.qty * tran.price
            self.list_pnl.append( tran.qty * (tran.price - self.buy_amount/self.outstanding_qty))
            self.no_of_trades=self.no_of_trades+1
        else:
            self.preference=2
            self.outstanding_qty += tran.qty
            self.sell_amount +=tran.qty * tran.price
            self.no_of_trades=self.no_of_trades+1


    def is_max_loss_reached(self):
        #check if the max loss is reached
        current_loss =  sum(self.list_pnl)
        Max_loss_per_trade = (self.max_loss_perc_pd * self.opening_balance/100)/5
        if current_loss <=  Max_loss_per_trade:
            if self.no_of_trades>=5:
                return Max_loss_per_trade,True
        else:
            return Max_loss_per_trade,False
    def is_max_profit_reached(self):
        #check if the max profit is reached
        current_profit =  sum(self.list_pnl)
        if current_profit >=  self.max_profit_perc_pd * self.opening_balance/100:
            return True
        else:
            return False
class Strategy7:
    def __init__(self, user_data):
        self.user = user_transactions(user_data)
        self.broker = Broker()
        self.user_data = user_data
        self.preference=0
    def run(self, candle):
        print ('run: lbb', candle['lbb'], ', ubb: ', candle['ubb'], ', close: ', candle['close'])
        if candle["close"]-candle["ubb"] <= candle["ubb"]*0.01 or candle["ubb"]-candle["close"] <= candle["ubb"]*0.01:
            self.preference=2
            if self.is_sell(candle):
                self.Sell(candle)
            if self.is_buy(candle) and self.user.sell_flag==1:
                self.Buy(candle)
            return self.to_continue()
            
        else:
            self.preference=1
            if self.is_buy(candle):
                self.Buy(candle)
            if self.is_sell(candle) and self.user.buy_flag==1:
                self.Sell(candle)
            return self.to_continue()

    def buy_rank(self, candle):
        rank=(10 if candle['trend']=='up' else 0)+(-10 if candle['trend']=='down' else 0) + (10 if candle['close'] <= candle['lbb'] * 1.01 else 0) + (-10 if candle['close'] >= candle['ubb'] * 0.99 else 0) + (10 if candle['close']>candle['open'] else 0) 
        print('buy_rank:', rank)
        return rank

    def sell_rank(self,candle):
        rank=(-10 if candle['trend']=='up' else 0) +(10 if candle['trend']=='down' else 0) + (-10 if candle['close'] <= candle['lbb'] * 1.01 else 0) + (10 if candle['close'] >= candle['ubb'] * 0.99 else 0) + (10 if candle['close']<candle['open'] else 0)
        print('sell_rank:', rank)
        return rank

    def Buy(self, candle):
        balance = self.user.get_current_balance()
        qty = int(balance / candle['close'])
        tran = Transaction_data (0, qty, candle['close'], Transaction_data.BUY)
        tran = self.broker.Buy(tran)
        if tran.is_success:
            self.user.Buy_update(tran)
            print("bought at",candle["close"])
    def Sell(self, candle):
        if self.preference==1:
            qty = self.user.outstanding_qty
            tran = Transaction_data (0, qty, candle['close'], Transaction_data.SELL)
            tran = self.broker.Sell(tran)
            if tran.is_success:
                self.user.Sell_update(tran, self.preference)
                print("sold at",candle["close"])
        else:
            a,b=user_transactions(self.user_data).is_max_loss_reached()
            balance = self.user.get_current_balance()
            qty = int((int(balance / candle['close']))*a)/100
            tran = Transaction_data (0, qty, candle['close'], Transaction_data.SELL)
            tran = self.broker.Sell(tran)
            if tran.is_success:
                self.user.Sell_update(tran)
                print("sold at",candle["close"])

    def is_buy(self,candle):
        #if candle is near lbb (+1%), buy
        rank=self.buy_rank(candle)
        if self.preference==1:
            if candle['close'] <= candle['lbb'] * 1.01 and rank>0:
                if self.user.get_current_balance() > candle['close']:
                    print("buy_rank pass")
                    self.user.buy_flag=1
                    return True
                else:
                    return False
        else:
             if candle['close'] >= candle['lbb'] * 1.01 and rank>0:
                if self.user.get_current_balance() > candle['close']:
                    print("buy_rank pass")
                    self.user.buy_flag=1
                    return True
                else:
                    return False
    def is_lessthan_range(self, ref_val, val):
        err = .01 * val 
        if err > 10:
            err = 10
        if  val < ref_val + err:
            return True
        else:
            return False
        
    def is_morethan_range(self, ref_val, val):
        err = .01 * val 
        if err > 10:
            err = 10
        if  val > ref_val - err:
            return True
        else:
            return False

    def is_sell(self,candle):
        #check if there is outstanding qty
        rank=self.sell_rank(candle)
        ubb, lbb, close = candle['ubb'], candle['lbb'], candle['close'] 
        #if candle is near ubb (-1%), sell
        if self.preference==1:
            if self.user.outstanding_qty == 0:
                return False
            if self.is_morethan_range(ubb, close) and rank > 0:
            #if candle['close'] >= candle['ubb'] * 0.99 and rank>0:
                print("sell_rank pass")
                self.user.sell_flag=1
                return True
            else:
                return False
        if self.preference==2:
            if self.is_morethan_range(ubb, close) and rank > 0 and self.user.outstanding_qty==0:
            #if candle['close'] <= candle['ubb'] * 0.99 and rank>0 and self.user.outstanding_qty==0:
                print("sell_rank pass")
                self.user.sell_flag=1
                return True
            else:
                return False

    def to_continue(self):
        #check if the max loss or max profit is reached
        if self.user.is_max_loss_reached() or self.user.is_max_profit_reached():
            return False
        else:
            return True

